import React, {Component} from 'react';

class UsersList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      selectedUser: {},
    };
  }

  selectUser(user) {
    this.setState({selectedUser: user});
  }

  render() {
    let userElements;
    if (this.props.users.length) {
      userElements = this.props.users.map((user, idx) => (
        <li key={idx} onClick={() => this.selectUser(user)}>{user.name}</li>
      ));
    } else {
      userElements = 'No Users registered yet.'
    }
    return (
      <div>
        <h1>Registrations</h1>
        <div className="col-split">
          <ul>
            {userElements}
          </ul>
          <div className="user-detail">
            Name: { this.state.selectedUser.name }
            Username: { this.state.selectedUser.name }
            Email: { this.state.selectedUser.name }
            : { this.state.selectedUser.name }
            Name: { this.state.selectedUser.name }
          </div>
        </div>
      </div>
    );
  }
}

export default UsersList;
